import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import { HiMenu } from "react-icons/hi"; // Import the hamburger menu icon

const HamburgerMenu = ({ isMenuOpen, onToggleMenu }) => {
  return (
    <Navbar bg="light" expand="md" className={`${isMenuOpen ? "d-md-none" : "d-none"}`}>
      <Navbar.Brand className={` ${isMenuOpen ? "d-md-none" : "d-none"}`}>Meal Viewer</Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" onClick={onToggleMenu} />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto"></Nav>
        <Nav>
          {/* Add any other menu items you need here */}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default HamburgerMenu;
